import {createGlobalStyle} from 'styled-components'
export const GlobalStyle1 = createGlobalStyle`
  @font-face {
    font-family: "iconfont";
    src: url('./iconfont.eot?t=1589102882634'); /* IE9 */
    src: url('./iconfont.eot?t=1589102882634#iefix') format('embedded-opentype'), /* IE6-IE8 */
